package com.rongke.model;import com.fasterxml.jackson.annotation.JsonFormat;import com.fasterxml.jackson.databind.annotation.JsonDeserialize;import com.fasterxml.jackson.databind.annotation.JsonSerialize;import com.rongke.utils.DateJsonDeserializer;import com.rongke.utils.DateJsonSerializer;import org.springframework.format.annotation.DateTimeFormat;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import java.io.Serializable;/** * @UserContact * @用户联系人(user_contact) * @version : Ver 1.0 */@TableName("user_contact")public class UserContact implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private java.lang.Long id;	/**	 * @备注:	 * @字段:user_id BIGINT(19)	 */	@JsonFormat(shape = JsonFormat.Shape.STRING)	private java.lang.Long userId;	/**	 * @备注:联系人姓名	 * @字段:name VARCHAR(45)	 */	private java.lang.String name;	/**	 * @备注:联系人电话	 * @字段:phone VARCHAR(12)	 */	private java.lang.String phone;	/**	 * @备注:与联系人关系	 * @字段:relation VARCHAR(45)	 */	private java.lang.String relation;	/**	 * @备注:	 * @字段:emergency_contact ENUM(6)	 */	private java.lang.String emergencyContact;	/**	 * @备注: 通话总次数	 * @字段:call_count	 */	private Integer callCount;	/**	 * @备注:	 * @字段:gmt_datetime DATETIME(19)	 */	@JsonSerialize(using=DateJsonSerializer.class)	@JsonDeserialize(using=DateJsonDeserializer.class)	@DateTimeFormat(pattern = "yyyy-MM-dd HH:mm:ss" )	private java.util.Date gmtDatetime;	/**	 * @备注:	 * @字段:upt_datetime DATETIME(19)	 */	@JsonSerialize(using=DateJsonSerializer.class)	@JsonDeserialize(using=DateJsonDeserializer.class)	@DateTimeFormat(pattern = "yyyy-MM-dd HH:mm:ss" )	private java.util.Date uptDatetime ;	/**	 * 备注:用户id	 */	@TableField(exist = false)	private User user;	public UserContact(){	}	public UserContact(		java.lang.Long id	){		this.id = id;	}	public void setId(java.lang.Long id) {		this.id = id;	}	public java.lang.Long getId() {		return this.id;	}	public void setUserId(java.lang.Long userId) {			this.userId = userId;			}	public java.lang.Long getUserId() {			return this.userId;	}	public void setUser(User user) {		this.user = user;	}	public User getUser() {		return this.user;	}	public void setName(java.lang.String name) {		this.name = name;	}	public java.lang.String getName() {		return this.name;	}	public void setPhone(java.lang.String phone) {		this.phone = phone;	}	public java.lang.String getPhone() {		return this.phone;	}	public void setRelation(java.lang.String relation) {		this.relation = relation;	}	public java.lang.String getRelation() {		return this.relation;	}	public void setEmergencyContact(java.lang.String emergencyContact) {		this.emergencyContact = emergencyContact;	}	public java.lang.String getEmergencyContact() {		return this.emergencyContact;	}	public void setGmtDatetime(java.util.Date gmtDatetime) {		this.gmtDatetime = gmtDatetime;	}	public java.util.Date getGmtDatetime() {		return this.gmtDatetime;	}	public void setUptDatetime(java.util.Date uptDatetime) {		this.uptDatetime = uptDatetime;	}	public java.util.Date getUptDatetime() {		return this.uptDatetime;	}	public Integer getCallCount() {		return callCount;	}	public void setCallCount(Integer callCount) {		this.callCount = callCount;	}}